import React from "react";
import styled from "styled-components";
const Container = styled.section`
    background-color: ${(props) => (props.isPractice ? "#692692" : "#405cc1")};
    margin: 0;
    padding: 0;
    box-shadow: 0px 0px 20px 0px rgba(0, 0, 0, 0.35);
    border-radius: 5px;
    height: 100%;
`;
const UL = styled.table`
    color: white;
    margin: 5px;
    padding: 10px;
`;
const P = styled.p`
    font-size: 1.2em;
    margin: 5px 0px;
    font-weight: 700;
`;
const List = ({ isPractice, day, children }) => {
    return (
        <Container isPractice={isPractice}>
            <P>{day}</P>
            <UL>
                <tr>
                    <th>Egzamin</th>
                    <th>Godzina</th>
                    <th>Miejsca</th>
                </tr>
                {children}
            </UL>
        </Container>
    );
};

export default List;
